// eslint-disable-next-line
import React from 'react';

import TodoListItem from './todo-list-item'


const ToDoList = ({todos}) => {
    return (<ul>
        <li><TodoListItem 
        label={todos[0].label} 
        important={todos[0].important}/> </li>
        <li><TodoListItem 
        label={todos[1].label} 
        important={todos[1].important}/></li>
        <li><TodoListItem 
        label={todos[2].label} 
        important={todos[2].important}
         
        /></li> 
    </ul>)// label -свойство компонента props.
    // important - булеан, который тоже свойство компонента props.
    // эти свойства используются в другом компоненте, для прописывания 
    // признаков отдельного item в списке todo
}
export default ToDoList;
